INSERT INTO `fm3_evince_cvsanaly2_svn_scm`.`scmlog` VALUES  (1,'1',1,NULL,'1999-04-17 04:59:58','New repository initialized by cvs2svn.\n',0,1),
 (2,'2',2,NULL,'1999-04-17 04:59:58','Initial revision\n\n',0,1),
 (3,'3',1,NULL,'1999-04-17 04:59:59','This commit was manufactured by cvs2svn to create branch \'DEREK\'.\n',0,1),
 (4,'4',2,NULL,'1999-04-17 04:59:59','\n\nInitial import of Derek\'s XPDF program.\n\n',0,1),
 (5,'5',1,NULL,'1999-04-17 04:59:59','This commit was manufactured by cvs2svn to create tag \'XPDF_0_80\'.\n',0,1),
 (6,'6',2,NULL,'1999-05-16 16:11:28','Initial work I did on GNOME/PDF viewer -miguel\n\n',0,1),
 (7,'7',3,NULL,'1999-05-27 19:38:32','Preliminary hacks.\n\n',0,1),
 (8,'8',3,NULL,'1999-05-28 00:07:00','More fixups, half way through.\n\n',0,1),
 (9,'9',3,NULL,'1999-05-29 00:28:58','slow progress...\n\n',0,1),
 (10,'10',3,NULL,'1999-05-29 14:35:54','GOutputDev now compiles... move onto gpdf GUI.\n\n',0,1),
 (11,'11',3,NULL,'1999-05-30 00:10:37','Brutal hack of rendering for now, needs sensible font support.\n\n',0,1),
 (12,'12',3,NULL,'1999-06-03 21:46:15','Fix some amusing bugs.\n\n',0,1),
 (13,'13',3,NULL,'1999-06-04 00:00:55','More bits.\n\n',0,1),
 (14,'14',3,NULL,'1999-06-10 00:46:15','Still no output - how odd.\n\n',0,1),
 (15,'15',3,NULL,'1999-07-29 19:57:51','More thrashing, now it prints \'Hello\': wow.\n\n',0,1),
 (16,'16',3,NULL,'1999-07-29 20:32:12','Renders pdf in one shade of black.\n\n',0,1),
 (17,'17',3,NULL,'1999-07-29 21:07:21','Some cleanups.\n\n',0,1),
 (18,'18',3,NULL,'1999-07-30 00:37:06','Colours, and cut down bug to clipping regions.\n\n',0,1),
 (19,'19',3,NULL,'1999-07-30 03:19:19','Located bug in handling of gdk_region... people expect\ngdk_region_union_with_rect to behave like the X call (?), its rather odd...\n\n',0,1),
 (20,'20',3,NULL,'1999-08-01 23:47:54','Begginings of glade GUI,\nmore cleans.\n\n',0,1),
