 (3581,'3581',43,NULL,'2009-04-08 15:13:41','2009-04-08  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* po/POTFILES.in:\n\n	Add previewer files to POTFILES.in.\n',0,1),
 (3582,'3582',43,NULL,'2009-04-08 15:35:11','2009-04-08  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* shell/ev-window.c: (ev_window_clear_temp_symlink),\n	(ev_window_dispose):\n\n	Delete the temp symlink created when opening a copy.\n',0,1),
 (3583,'3583',43,NULL,'2009-04-08 15:43:06','2009-04-08  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* shell/ev-window.c: (window_open_file_copy_ready_cb),\n	(reload_remote_copy_ready_cb), (window_save_file_copy_ready_cb):\n\n	Use g_error_matches() instead of manually check error code and\n	domain.\n',0,1),
 (3584,'3584',43,NULL,'2009-04-08 17:42:49','2009-04-08  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* configure.ac:\n	* cut-n-paste/Makefile.am:\n	* cut-n-paste/evmountoperation/*: Removed\n	* po/POTFILES.in:\n	* shell/Makefile.am:\n	* shell/ev-print-operation.c:\n	* shell/ev-window.c: (window_open_file_copy_ready_cb),\n	(ev_window_cmd_help_contents), (launch_action),\n	(launch_external_uri):\n\n	Bump GTK+ requirement to 2.14.\n',0,1),
 (3585,'3585',58,NULL,'2009-04-09 00:14:07','2009-04-08  Dan Winship  <danw@gnome.org>\n	* cut-n-paste/smclient/eggsmclient-xsmp.c (save_state):\n	\n	Fix the .desktop-file-as-state-file case;\n	egg_desktop_file_get_source() returns a URI, not a filename.\n\n\n',0,1),
 (3586,'3586',203,NULL,'2009-04-09 00:34:02','2009-04-09  Benjamin Berg  <benjamin@sipsolutions.net>\n\n	* backend/dvi/cairo-device.c: (dvi_cairo_put_pixel):\n	Fix output on big endian machines. Fixes bug #578433.\n\n',0,1),
 (3587,'3587',203,NULL,'2009-04-09 00:38:09','2009-04-09  Benjamin Berg  <benjamin@sipsolutions.net>\n\n	* backend/dvi/cairo-device.c: (dvi_cairo_put_pixel):\n	Fix output on big endian machines. Fixes bug #578433.\n\n',0,1),
 (3588,'3588',58,NULL,'2009-04-09 00:50:56','2009-04-08  Dan Winship  <danw@gnome.org>\n \n	* cut-n-paste/smclient/eggsmclient-xsmp.c (save_state):\n 	\n 	Fix the .desktop-file-as-state-file case;\n 	egg_desktop_file_get_source() returns a URI, not a filename.\n\n\n',0,1),
 (3589,'3589',203,NULL,'2009-04-09 22:36:17','2009-04-09  Benjamin Berg  <benjamin@sipsolutions.net>\n\n	* backend/tiff/tiff-document.c: (tiff_document_render):\n	Fix tiff pixel conversion on big endian machines. Fixes bug #509920.\n\n',0,1),
 (3590,'3590',203,NULL,'2009-04-09 22:36:29','2009-04-09  Benjamin Berg  <benjamin@sipsolutions.net>\n\n	* backend/tiff/tiff-document.c: (tiff_document_render):\n	Fix tiff pixel conversion on big endian machines. Fixes bug #509920.\n\n',0,1),
 (3591,'3591',26,NULL,'2009-04-10 05:24:30','Updated zh_CN translation.\n',0,1),
