 (3594,'3594',151,NULL,'2009-04-10 12:17:19','Updated Serbian translation (by Milo?\\197?\\161 Popovi?\\196?\\135)\n',0,1),
 (3595,'3595',43,NULL,'2009-04-10 12:37:56','2009-04-10  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* properties/ev-properties-main.c: (ev_properties_get_pages):\n\n	Create and load the document based on the mime-type provided by\n	nautilus instead of using our own documents factory. Fixes bug\n	#533917.\n',0,1),
 (3596,'3596',43,NULL,'2009-04-10 12:41:49','2009-04-10  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* properties/ev-properties-main.c: (ev_properties_get_pages):\n\n	Create and load the document based on the mime-type provided by\n	nautilus instead of using our own documents factory. Fixes bug\n	#533917.\n\n\n',0,1),
 (3597,'3597',43,NULL,'2009-04-10 15:57:32','2009-04-10  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* shell/ev-window.c: (ev_window_create_tmp_symlink):\n\n	Use g_file_make_symbolic_link to create symlinks. Patch by Hib\n	Eris. See bug #339172.\n',0,1),
 (3598,'3598',43,NULL,'2009-04-10 16:22:16','2009-04-10  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* shell/main.c: (main):\n\n	Change process working directory to $HOME so that we don\'t prevent\n	unmounting in case the initial cwd is on an external device. Fixes\n	bug #575436.\n',0,1),
 (3599,'3599',43,NULL,'2009-04-10 16:25:01','2009-04-10  Carlos Garcia Campos  <carlosgc@gnome.org>\n\n	* shell/main.c: (main):\n\n	Change process working directory to $HOME so that we don\'t prevent\n	unmounting in case the initial cwd is on an external device. Fixes\n	bug #575436.\n\n\n',0,1),
